let projInfoList = { // Implemented as table instead of array so it's easier to keep track of the IDs
    0: {
      
    }
  };
  
export default class ProjectState {
    constructor() {
      this.projNum = 0;
      this.stateInfo = projInfoList[0];
    }
  
    set projNum(id) {
      if(~~projInfoList[id]) {
        console.error("Attempted to display project #" + id + ", which does not exist.");
        return;
      }
  
      this.projNum = id;
  
    }
  }
